const ProductSale = (prop) => {
  return (
    <div className={prop.class}>
      <div className="product-image" key={prop.key}>
        <img src={require( `${ prop.src }`)} alt={prop.alt} />
      </div>
      <span className="product-price">{prop.price}</span>
    </div>
  );
};

export default ProductSale;
